import { useState } from 'react'


const Tasks = () => {
    const [tasks, setTasks] = useState([
        {name:"Dentist", id:1},
        {name:"School", id:2},
        {name:"Homework", id:3}
    ])
  return (
    <>
    {tasks.map((task)=>(
    <h3 key={task.id}>{task.name}</h3>
    ))}
    </>
  )
}

export default Tasks
